import React, { useState } from 'react';
import axios from 'axios';

export default function Upload() {
  const [file, setFile] = useState(null);
  const [status, setStatus] = useState('');
  const [id, setId] = useState('');

  const upload = async () => {
    if (!file) {
      setStatus('Please select a video file');
      return;
    }
    try {
      const fd = new FormData();
      fd.append('video', file);
      const { data } = await axios.post('http://localhost:3001/api/upload', fd);
      setId(data.id);
      setStatus('processing');
      checkStatus(data.id);
    } catch (error) {
      setStatus('Upload failed: ' + (error.response?.data || error.message));
    }
  };

  const checkStatus = async (videoId) => {
    try {
      const { data } = await axios.get(`http://localhost:3001/api/task/${videoId}`);
      setStatus(data.status);
      if (data.status === 'processing') {
        setTimeout(() => checkStatus(videoId), 2000);
      }
    } catch (error) {
      setStatus('Status check failed: ' + (error.response?.data || error.message));
    }
  };

  return (
    <div style={{ textAlign: 'center' }}>
      <div style={{ 
        marginBottom: '30px',
        padding: '30px',
        border: '3px dashed #667eea',
        borderRadius: '25px',
        backgroundColor: '#f8f9ff',
        transition: 'all 0.3s ease'
      }}>
        <div style={{
          width: '60px',
          height: '60px',
          borderRadius: '50%',
          backgroundColor: '#667eea',
          margin: '0 auto 15px auto',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          color: 'white',
          fontSize: '24px',
          fontWeight: 'bold'
        }}>üìπ</div>
        <label style={{ 
          display: 'block', 
          marginBottom: '15px', 
          fontSize: '18px', 
          fontWeight: 'bold',
          color: '#333'
        }}>Select Football Video File</label>
        <input 
          type="file" 
          accept="video/*" 
          onChange={e => setFile(e.target.files[0])}
          style={{
            padding: '15px 20px',
            border: '2px solid #667eea',
            borderRadius: '25px',
            backgroundColor: 'white',
            cursor: 'pointer',
            fontSize: '16px',
            width: '100%',
            maxWidth: '300px'
          }}
        />
      </div>
      <button 
        onClick={upload}
        style={{
          padding: '18px 40px',
          backgroundColor: '#667eea',
          color: 'white',
          border: 'none',
          borderRadius: '30px',
          fontSize: '18px',
          fontWeight: 'bold',
          cursor: 'pointer',
          marginBottom: '25px',
          boxShadow: '0 6px 20px rgba(102, 126, 234, 0.4)',
          transition: 'all 0.3s ease'
        }}
      >
        üöÄ Upload & Analyze
      </button>
      {status && (
        <div style={{
          padding: '20px',
          backgroundColor: status === 'done' ? '#e8f5e8' : status.includes('failed') ? '#ffe8e8' : '#fff8e1',
          border: `3px solid ${status === 'done' ? '#4caf50' : status.includes('failed') ? '#f44336' : '#ff9800'}`,
          borderRadius: '20px',
          marginBottom: '25px',
          fontSize: '18px',
          fontWeight: 'bold',
          color: status === 'done' ? '#2e7d32' : status.includes('failed') ? '#c62828' : '#ef6c00'
        }}>
          <div style={{
            width: '40px',
            height: '40px',
            borderRadius: '50%',
            backgroundColor: status === 'done' ? '#4caf50' : status.includes('failed') ? '#f44336' : '#ff9800',
            margin: '0 auto 10px auto',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            color: 'white',
            fontSize: '20px'
          }}>
            {status === 'done' ? '‚úÖ' : status.includes('failed') ? '‚ùå' : '‚è≥'}
          </div>
          Status: {status}
        </div>
      )}
      {status === 'done' && (
        <div style={{ 
          marginTop: '30px',
          padding: '30px',
          backgroundColor: '#f0f8f0',
          borderRadius: '25px',
          border: '3px solid #4caf50'
        }}>
          <div style={{
            width: '60px',
            height: '60px',
            borderRadius: '50%',
            backgroundColor: '#4caf50',
            margin: '0 auto 20px auto',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            color: 'white',
            fontSize: '24px'
          }}>üéØ</div>
          <h3 style={{ 
            marginBottom: '20px', 
            color: '#2e7d32',
            fontSize: '24px',
            fontWeight: 'bold'
          }}>AI Analysis Complete!</h3>
          <video
            src={`http://localhost:3001/api/result/${id}`}
            controls
            width="100%"
            style={{
              maxWidth: '700px',
              border: '3px solid #4caf50',
              borderRadius: '20px',
              boxShadow: '0 10px 30px rgba(76, 175, 80, 0.3)'
            }}
          />
        </div>
      )}
    </div>
  );
}
